import React from 'react'
import { Link, useHistory } from 'react-router-dom'
import { storageService } from '../services/storageService';

export function UsersModal({ profiles }) {
    const history = useHistory()
    const changeProfile = (profile) => {
        console.log('userId is:', profile);
        storageService.saveToStorage('profile', profile)
        history.push('/user')
    }

    return (
        <div className="user-modal">
            <div className="flex col users-list-modal">
                {profiles?.map(profile => {
                    return <div
                        key={profile._id}
                        className="user flex align-center" >
                        <img className="img-users" src={profile.color} alt="user-img" />
                        <Link to="/user"
                            className="user-name"
                            onClick={() => changeProfile(profile)}>
                            {profile.name}
                        </Link>
                    </div>
                })}
            </div>
            <div className="bottom flex col">
                <Link>Account</Link>
                <Link>Help</Link>
                <Link>Logout from Netflix</Link>
            </div>
        </div>
    )
}
